import React from "react";
import { MDBListGroup, MDBListGroupItem } from 'mdb-react-ui-kit';

function ArchiveList(props) {

  const tasks = props.archiveTasks;

  function createTaskList() {
    return (
      <div className="h-95 p-5 bg-body-tertiary border rounded-3 mt-2">
        <h3 className="archive-list-title">Archive Lists</h3>
        <p>Good Job!</p>
        <MDBListGroup bulleted style={{ minWidth: '22rem' }} light small>
      <MDBListGroupItem>Cras justo odio</MDBListGroupItem>
      <MDBListGroupItem>Dapibus ac facilisis in</MDBListGroupItem>
      <MDBListGroupItem>Morbi leo risus</MDBListGroupItem>
      <MDBListGroupItem>Porta ac consectetur ac</MDBListGroupItem>
      <MDBListGroupItem>Vestibulum at eros</MDBListGroupItem>
    </MDBListGroup>
        <ul>
          {tasks.map((task, index) => (
            <li key={index}>{task}</li>
          ))}
        </ul>
      </div>
    );
  }

  return createTaskList();
}

export default ArchiveList;
